@toristory_x That’s OKAY! We’ve all had those days.

You could add 100 words/day for the rest of the month and catch up gradually if you want to. Small chunks is a lot easier to handle than the cumulative total. 

I’ve been channeling my nervousness and rage with energy drinks and words. 🤷🏻‍♀️

@RealRLimbaugh @EricTrump this has kinda a new meaning to me now. the light being goodness. a small part of a poem by Dylan Thomas.
"Do not go gentle into that good night,
Old age should burn and rave at close of day;
Rage, rage against the dying of the light."
